import './Navbar.css';
import { Link } from 'react-router-dom';
import React from 'react';

function Navbar() {
  return(
    React.createElement("header", { className: "navbar" }, 
    React.createElement("div", { className: "navbar__title"},<Link to="/"><img className="logo" src="webshio.png" alt=""/> 
    </Link>),
    React.createElement("div", { className: "navbar__item"},<Link to="add-item"><img className="item" src="add.svg" alt=""/>
    </Link>, "Add Item"), 
    React.createElement("div", { className: "navbar__item"},<Link to="add-category"><img className="category" src="category.svg" alt=""/>
    </Link>, "Add Category"), 
    React.createElement("div", { className: "navbar__item"},<Link to="cart"><img className="cart" src="cart.svg" alt=""/>
  </Link>,"Cart")
  ))
}


export default Navbar
